import React from 'react'
import Popular from '../../../interface/Popular';
import PopularRestaurants from './PopularRestaurants';

interface PopularProps {
  populars: Popular[];
}
const PopularRestaurant:React.FC<PopularProps> = ({populars}: PopularProps) => {
  {populars.map(item => {
    return  (
    <PopularRestaurants restaurantName={item.restaurantName} chefName={item.chefName}></PopularRestaurants>
  )
})}
}

export default PopularRestaurant;
